 old of a vehicle. "]},{"cell_type":"code","execution_count":5,"id":"66bd5f0a","metadata":{"execution":{"iopub.execute_input":"2024-11-09T03:41:28.011754Z","iopub.status.busy":"2024-11-09T03:41:28.01007Z","iopub.status.idle":"2024-11-09T03:41:28.042546Z","shell.execute_reply":"2024-11-09T03:41:28.040671Z"},"papermill":{"duration":0.053743,"end_time":"2024-11-09T03:41:28.0461","exception":false,"start_time":"2024-11-09T03:41:27.992357","status":"completed"},"tags":[]},"outputs":[],"source":["# feature transforms, and engineering\n","df$price <- log10(df$price)\n","df$milage <- log10(df$milage)\n","df$model_year <- 2025 - df$model_year\n","df$age_miles <- df$milage / df$model_year"]},{"cell_type":"markdown","id":"c635c8bb","metadata":{"papermill":{"duration":0.013784,"end_time":"2024-11-09T03:41:28.073764","exception":false,"start_time":"2024-11-09T03:41:28.05998","status":"completed"},"tags":[]},"source":["If our minimum model year is less than 1 we'll see errors in this process. \n","\n","Let's check to see the minimum and maximum model years."]},{"cell_type":"code","execution_count":6,"id":"ba200aa3","metadata":{"execution":{"iopub.execute_input":"2024-11-09T03:41:28.105444Z","iopub.status.busy":"2024-11-09T03:41:28.103694Z","iopub.status.idle":"2024-11-09T03:41:28.136415Z","shell.execute_reply":"2024-11-09T03:41:28.134547Z"},"papermill":{"duration":0.051474,"end_time":"2024-11-09T03:41:28.139237","exception":false,"start_time":"2024-11-09T03:41:28.087763","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["1"],"text/latex":["1"],"text/markdown":["1"],"text/plain":["[1] 1"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["51"],"text/latex":["51"],"text/markdown":["51"],"text/plain":["[1] 51"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["9.17000206860337"],"text/latex":["9.17000206860337"],"text/markdown":["9.17000206860337"],"text/plain":["[1] 9.170002"]},"metadata":{},"output_type":"display_data"}],"source":